import React from 'react';
import './header.css';

const Header = () => {
  return (
    <section name='header' id='header'>
      {/* <h3 className='descriptorWrapper'> */}
        <span className='descriptor'>Student</span>
        <span className='descriptor'>Programmer</span>
        <span className='descriptor'>Learner</span>
        <span className='descriptor'>Dreamer</span>
        <span className='descriptor'>Reader/Writer</span>
      {/* </h3> */}
      <h1 className='name'>Hi!   I'm Jacqueline Zamitalo</h1>
      {/* <h3 className='descriptorWrapper'> */}
          <span className='descriptor'>Cinephile</span>
          <span className='descriptor'>Tech Enthusiast</span>
          <span className='descriptor'>Gamer</span>
          <span className='descriptor'>Sports Lover</span>
      {/* </h3> */}
    </section>
  )
}

export default Header
